'use strict'

class URLInput {
    constructor() {
        this.mode = 'single'
        this.api_gateway_key = 'qQX1Vd3Z3f1MCbJrcMBtc2h5dwx82CO8efTgx993'
        this.element = document.querySelector('.c-url')
        this.section = this.element.parentElement
        this.btn = document.querySelector('.c-url__btn')
        this.urlBar = document.querySelector('.c-urlbar')
        this.downloadPDFbtn = document.querySelector('.c-btn-single-download')
        this.downloadCSVbtn = document.querySelector('.c-btn-bulk-download')
        this.bulkSection = document.querySelector('#bulk-section')
        this.singleSection = document.querySelector('#single-section')
        this.singleChartSection = document.querySelector('#single-chart-section')

        this._onInput = this._onInput.bind(this)
        this._onSingleInputValidate = this._onSingleInputValidate.bind(this)
        this._onSubmit = this._onSubmit.bind(this)
        this._inactivateInput = this._inactivateInput.bind(this)
        this._activateInput = this._activateInput.bind(this)
        this._downloadPDF = this._downloadPDF.bind(this)
        this._downloadCSV = this._downloadCSV.bind(this)
        this._resolveUrl = this._resolveUrl.bind(this)
        //this.convertArrayOfObjectsToCSV = this.convertArrayOfObjectsToCSV.bind(this)

        this._manageNewLines()
        this._setPlaceholder()
        this._setSectionDisplay()
        this._addEvents()
        fbChart(["40", "50", "90"]);
        allChart([27373, 121, 390, 12856, 9741, 2832, 547, 13300, 10100, 7511, 9241, 1490, 13456]);
        mtChart("86");
    }

    _addEvents() {
        this.element.addEventListener('input', this._onInput)
        this.btn.addEventListener('click', this._onSubmit)
        this.downloadPDFbtn.addEventListener('click', this._downloadPDF)
        this.downloadCSVbtn.addEventListener('click', this._downloadCSV)
    }

    _removeEvents() {
        this.element.removeEventListener('input', this._onInput)
    }

    _onInput(e) {
        // Allow only one new line
        e.target.value = e.target.value.replace('\n\n', '\n')

        this._setBtnState()
    }

    _resolveUrl(url){
        let newUrl = url
        if (!/^https?:\/\//i.test(url)) {
            newUrl = 'http://' + url
        } else{
            newUrl = url
        }
        return newUrl;
    }

    _onSingleInputValidate(website){
      var err = validate({website: website}, {website: {url: true}})
      if(err != undefined){
        swal("Invalid Input", "Please verify input URL : should start with http OR https!", "error")
        return false
      }
      return true
    }

    _onBulkInputValidate(){
      var inputArray = this.element.value.trim().split('\n')
      if(inputArray.length > 10){
        swal("Too many URLs", "Please enter maximum 10 URL!", "error")
        return false
      }
      for(var i = 0; i<inputArray.length; i++){
        var err = validate({website: inputArray[i]}, {website: {url: true}})
        if(err != undefined){
          swal("Invalid Input", "Please verify input URL : " + inputArray[i], "error")
          return false
        }
      }
      return true
    }

    _onSubmit(){
        var context = this
        context._inactivateInput()
        var config = {
            apiKey: this.api_gateway_key
        }

        var apigClient = apigClientFactory.newClient(config);

        if(context.mode == "single"){
          let website = this._resolveUrl(this.element.value)

          var valid = context._onSingleInputValidate(website)
          if(!valid){
            context._activateInput()
            return
          }
          apigClient.urlSharecountGet({"url": website}, {})
              .then(function(result){
                  var url_result = new URLResult();
                  url_result._updateCount(result.data);
                  context.singleResult = result.data;
                  context._activateInput()
                  //This is where you would put a success callback
              }).catch( function(error){
                swal("Hmm!", "Please verify input. Unable to fetch count!", "error")
                context._activateInput()
                  //This is where you would put an error callback
              });

        } else if(this.mode == "bulk") {
          var valid = context._onBulkInputValidate()
          if(!valid){
            context._activateInput()
            return
          }
          apigClient.bulkUrlsSharecountPost({
            "Authorization": "Bearer " + localStorage.getItem('id_token')
          }, {"urls": this.element.value.trim().split('\n')})
              .then(function(result){
                  var url_result = new URLResult();
                  url_result._updateBulkCount(result.data);
                  context.bulkResult = result.data;
                  context._activateInput()
                  //This is where you would put a success callback
              }).catch( function(error){
                swal("Hmm!", "Please verify input. Unable to fetch count!", "error")
                context._activateInput()
                  //This is where you would put an error callback
              });
        }


    }

    _inactivateInput() {
        this.urlBar.classList.add('is-inactive')
    }

    _activateInput() {
        this.urlBar.classList.remove('is-inactive')
    }

    _blockEnterKeyListener(e) {
        e.which === 13 && e.preventDefault()
    }

    _manageNewLines() {
        this.mode === 'single'
            ? this.element.addEventListener('keydown', this._blockEnterKeyListener)
            : this.element.removeEventListener('keydown', this._blockEnterKeyListener)
    }

    _setPlaceholder(setAfterTransition) {
        const set = () => this.element.setAttribute('placeholder',
            this.element.dataset[`${ this.mode }Placeholder`])

        if (!setAfterTransition) {
            set()
            return
        }

        const _setPlaceholder = function () {
            set()
            this.element.removeEventListener('transitionend', _setPlaceholder)
        }.bind(this)

        this.element.addEventListener('transitionend', _setPlaceholder)
    }

    _setSectionDisplay(){
      this.mode === 'bulk' ? this.bulkSection.style.display = 'block' : this.bulkSection.style.display = 'none';
      this.mode === 'single' ? this.singleSection.style.display = 'block' : this.singleSection.style.display = 'none';
      this.mode === 'single' ? this.singleChartSection.style.display = 'block' : this.singleChartSection.style.display = 'none';
    }

    _setBtnState() {
        if (!this.span) {
            this.span = document.createElement('span')
            this.btn.appendChild(this.span)
        }

        const count = this.element.value.trim().split('\n').length

        if (this.element.value.trim()) {
            this.span.innerText = ` ${ count } URL${ count > 1 ? 's' : '' }`
        } else {
            this.span.innerText = ''
        }
    }

    changeMode(mode) {
        this.mode = mode

        this.section.classList[this.mode === 'bulk' ? 'add' : 'remove']('is-bulk')

        this._manageNewLines()
        this._setPlaceholder(this.mode === 'bulk')
        this._setSectionDisplay()
    }

    _downloadPDF(){
      console.log('Single: ', this.singleResult)
      var urlValue = this.element.value
      var columns = [
          {title: "ID", dataKey: "id"},
          {title: "Social Site", dataKey: "name"},
          {title: "Count", dataKey: "count"}
      ];
      var rows = [];
      var i=0;
      for(var p in this.singleResult){
        i++
        console.log(p + " , " + this.singleResult[p] + "\n");
        rows.push({'id': i, 'name': p, 'count': this.singleResult[p]})
      };

      // Only pt supported (not mm or in)
      var doc = new jsPDF('p', 'pt');
      doc.autoTable(columns, rows, {
          theme: 'striped',
          styles: {},
          columnStyles: {},
          margin: {top: 150},
          beforePageContent: function(data) {
              var imageData = 'data:image/png;base64,'
              doc.addImage(imageData, 'PNG', 40, 40, 225, 27);
              //doc.text("Url: " + urlValue , 40, 80);
              var splitTitle = doc.splitTextToSize("Url: " + urlValue , 500);
              doc.text(40, 100, splitTitle);
          }
      });
      doc.save('marketingtool.pdf');

    }

    _downloadCSV() {
        var data, filename, link;
        var csv = this.convertArrayOfObjectsToCSV({
            data: this.bulkResult
        });
        if (csv == null) return;

        filename ='marketingtoolio.csv';

        if (!csv.match(/^data:text\/csv/i)) {
            csv = 'data:text/csv;charset=utf-8,' + csv;
        }
        data = encodeURI(csv);

        link = document.createElement('a');
        link.setAttribute('href', data);
        link.setAttribute('download', filename);
        link.click();
    }

    convertArrayOfObjectsToCSV(args) {
        var result, ctr, keys, columnDelimiter, lineDelimiter, data;

        data = args.data || null;
        if (data == null || !data.length) {
            return null;
        }

        columnDelimiter = args.columnDelimiter || ',';
        lineDelimiter = args.lineDelimiter || '\n';

        keys = Object.keys(data[0]);

        result = '';
        result += keys.join(columnDelimiter);
        result += lineDelimiter;

        data.forEach(function(item) {
            ctr = 0;
            keys.forEach(function(key) {
                if (ctr > 0) result += columnDelimiter;

                result += item[key];
                ctr++;
            });
            result += lineDelimiter;
        });

        return result;
    }

}
